        <div class="offer-section">
          <h2 class="offer-section__title">Prix et option à l'achat</h2>
          <p class="offer-section__description">Découvrez l'avenir de la mobilité avec des prix compétitifs et des
            options d'achat flexibles chez Auto Innovation.</p>
          <div class="box">
            <Perks />
          </div>
        </div>
      </div>

    </section>
  );
}

export default App;
